	return(
		<nav className="breadcrumb breadcrumb-gray">
            {
                items && items.map( (item, i) => (

                    <Link to={item.path} >{item.title}</Link>

                    // <Link to={item.path} key={item.path}>{item.title} ></Link>


                ) 
                )
            }
        </nav>
	);
}

